import React, {Component} from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import logo from './assets/anshor.space.png';

class Header extends Component{
  render(){
    return(
      <Navbar sticky="top" className="bg-bluegradient justify-content-between" expand="lg" variant="dark">
        <Navbar.Brand >
          <img
            src={logo}
            alt="anshor.space logo"
            className="align-top logo"
            />
        </Navbar.Brand>
        
        <Navbar.Collapse>
          <Nav>
            <a className="white-nav" href="/">ABOUT</a>
            <a className="white-nav" href="/">SKILL</a>
            <a className="white-nav" href="/">PROJECT</a>
            <a className="white-nav" href="/">CONTACT</a>
          </Nav>
        </Navbar.Collapse>

      </Navbar>
    );
  }
}

export default Header;
